Parameters:
  StandardModel_SLHA2:
    alphainv: 1.27950000E+02
    GF: 1.16637870E-05
    alphaS: 1.18100000E-01
    mZ: 9.11876000E+01
    mBmB: 4.18000000E+00
    mT: 1.73340000E+02
    mTau: 1.77686000E+00
    mNu3: 0
    mE: 5.10998946E-04
    mNu1: 0
    mMu: 1.05658375E-01
    mNu2: 0
    mD: 4.70000000E-03
    mU: 2.20000000E-03
    mS: 9.60000000E-02
    mCmC: 1.28000000E+00
    CKM_lambda: 0.22537
    CKM_A: 0.814
    CKM_rhobar: 0.117
    CKM_etabar: 0.353
    theta12: 0.58376
    theta23: 0.76958
    theta13: 0.15495
    delta13: 0
    alpha1: 0
    alpha2: 0
  MSSM7atQ:
    Qin:
      fixed_value: 1000.0
    SignMu:
      fixed_value: 1
    Ad_3:
      prior_type: double_log_flat_join
      ranges: [-1e4, -1e2, 1e2, 1e4]
    Au_3:
      prior_type: double_log_flat_join
      ranges: [-1e4, -1e2, 1e2, 1e4]
    M2:
      prior_type: double_log_flat_join
      ranges: [-1e4, -1e2, 1e2, 1e4]
    TanBeta:
      range: [3.0, 70.0]
      prior_type: flat
    mHd2:
      prior_type: double_log_flat_join
      ranges: [-1e8, -1e4, 1e4, 1e8]
    mHu2:
      prior_type: double_log_flat_join
      ranges: [-1e8, -1e4, 1e4, 1e8]
    mf2:
      prior_type: double_log_flat_join
      ranges: [0, 0, 1e4, 1e8]
Priors: ~
Printer:
  printer: hdf5
  options:
    group: /MSSM
    output_file: MSSM7atQ.hdf5
    delete_file_on_restart: true
    default_output_path: runs/FS_MSSM7atQ//samples/
Scanner:
  use_scanner: random
  scanners:
    de:
      plugin: diver
      like: LogLike
      NP: 10
      convthresh: 1e-3
      maxgen: 100
      verbosity: 3
    random:
      plugin: random
      like: LogLike
      point_number: 1000
      verbosity: 3
  default_output_path: runs/FS_MSSM7atQ//scanner_plugins/
ObsLikes:
  - purpose: Observable
    capability: MSSM_spectrum
    type: map_str_dbl
  - purpose: Observable
    capability: muon_gm2
  - purpose: LogLike
    capability: lnL_gm2
Rules:
  - capability: unimproved_MSSM_spectrum
    type: Spectrum
    function: get_MSSMatQ_spectrum_FS
  - capability: MSSM_spectrum
    type: Spectrum
    function: make_MSSM_precision_spectrum_none
  - capability: muon_gm2
    function: GM2C_SUSY
  - capability: muon_gm2_SM
    function: gm2_SM_ee
Logger:
  redirection:
    [Default]: default.log
    [Warning]: warning.log
    [Error, Fatal]: error.log
    [Debug]: debug.log
    [Core]: core.log
    [Dependency Resolver]: dep_res.log
    [Printers]: printer.log
    [PrecisionBit]: prec_bit.log
    [SpecBit]: spec_bit.log
    [SPheno]: spheno.log
  default_output_path: runs/FS_MSSM7atQ//logs/
KeyValues:
  dependency_resolution:
    prefer_model_specific_functions: true
  likelihood:
    model_invalid_for_lnlike_below: -1e6
  default_output_path: runs/FS_MSSM7atQ/
  debug: true